import React from 'react';
import Navigation from '../components/Navigation';
import Form from '../components/Form';

const Home = () => {
  return (
    <>
      <Navigation
        Title="URL-shortener"
        Links={[
          {
            title: 'Login',
            ref: '/login'
          }
        ]}
      />
      <Form />
    </>
  );
};

export default Home;
